Encoder's Note's
I dropped the SERENiTY cam (thanks) into vdubmod.
I sharpened it &amp; increased the gamma, contrast and brightness.
Then i lowered the saturation &amp; changed the colours with a rgb eq.
Finaly i muxed santas elfes rg's english cam audio (thanks) to my encode.
The video is ok its not great but its watchable.
The audio is actualy prety good for cam audio, its quiet so you will have to turn the volume up.
As always check out the sample first
Enjoy another Kingdom Release.

